document.addEventListener("DOMContentLoaded", function () {
  const dischargeForm = document.getElementById("discharge-form");
  
  if (dischargeForm) {
    dischargeForm.addEventListener("submit", function () {
      const redirectUrl = dischargeForm.getAttribute("data-redirect-url");
      
      setTimeout(function () {
        window.location.href = redirectUrl;
      }, 2000);
    });
  }
});

